import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';

export default function BasicList(props) {

    return (

        <List style={{ margin: 'auto', width: '50%', height: '100%', paddingTop: '30px' }}>

            {props.files.map((element, index) => {
                return (

                    <ListItem disablePadding key={index} style={{ paddingBottom: '5px', marginTop: index * 5 + 'px' }}>
                        <ListItemButton style={{ border: '2px solid #292929', borderRadius: '10px' }} onClick={() => props.setSelectedFile(element)}>
                            <ListItemText primary={'<i>'+element.split('_')[0]} secondary={element.split('_')[1].toUpperCase() + ' ' + element.split('_')[2] + ' ' + element.split('_')[3]+'</i>'} />
                        </ListItemButton>
                    </ListItem>

                )
            })}

        </List>

    )
}
